import React, {useState} from 'react';
import Signup from './Signup.js'

const accountState = [
    <Signup />
    ,
    <div>hello</div>
]

const Account = (props) => {
    const [accountDiv, setAccountDiv] = useState(accountState[0]);

    return(
    <div className="
    absolute backdrop-blur-md bg-white rounded-lg drop-shadow-xl w-1/2 justify-self-center m-auto left-0 right-0">
        {accountDiv}
    </div>
    )
};

export default Account;
